import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Button from 'react-bootstrap/Button';

function App() {
  return (
    <div>
      <h1 className="blue">
        Testing
      </h1>
      <Button variant='primary'>Click Me</Button>
    </div>
  );
}

export default App;
